INSERT INTO replies(id, text, post_id) --한 줄에 약 100개씩
VALUES (9, '그래픽이 감각적이고 매력적입니다. 디자인의 퀄리티가 뛰어나네요.', '662e2a38087eafa7b6afca9a'), (12, '색상 조합이 너무 조화롭고 아름답네요. 시각적으로 매력적입니다.', '662e2a38087eafa7b6afca9a'), (21, '색감이 너무 아름답고 고요한 느낌을 주네요. 정말 멋진 그래픽이에요.', '662e2a38087eafa7b6afca9a'), (6, '이미지를 보니 디자이너의 섬세함과 재능이 엿보입니다.', '662e2a38087eafa7b6afca9b'), (13, '이 그래픽을 보니 기분이 좋아지네요. 특별한 느낌이 들어요.', '662e2a38087eafa7b6afca9b'), (18, '이 그래픽은 한 마디로 말해 화려합니다. 시선을 사로잡습니다.', '662e2a38087eafa7b6afca9b'), (5, '그래픽에 사용된 비주얼 요소들이 서로 조화를 이루고 있어요. 환상적입니다.', '662e2a38087eafa7b6afca9c'), (13, '이미지가 담고 있는 메시지가 정말 인상적이에요. 잘 표현된 것 같아요.', '662e2a38087eafa7b6afca9c'), (2, '디자인이 트렌디하면서도 클래식한 느낌이 있어요. 참 멋지네요.', '662e2a38087eafa7b6afca9c'), (9, '이런 디자인을 보면서 와! 하고 소리내게 되네요. 훌륭합니다!', '662e2a38087eafa7b6afca9d'), (30, '이 디자인은 창의적이고 독창적입니다. 디자이너의 독특한 시각이 돋보여요.', '662e2a38087eafa7b6afca9d'), (23, '색상 선택이 너무나 멋지네요. 시각적인 즐거움을 주는 것 같아요.', '662e2a38087eafa7b6afca9d'), (10, '그래픽에 사용된 비주얼 요소들이 서로 조화를 이루고 있어요. 환상적입니다.', '662e2a38087eafa7b6afca9e'), (20, '이 디자인은 여러 가지 의미를 갖고 있어요. 다양한 해석이 가능합니다.', '662e2a38087eafa7b6afca9e'), (30, '이미지가 담고 있는 메시지가 정말 인상적이에요. 잘 표현된 것 같아요.', '662e2a38087eafa7b6afca9e'), (22, '디자인의 각 요소가 서로 어우러져 하나의 작품을 이루고 있네요.', '662e2a38087eafa7b6afca9f'), (23, '이 그래픽은 한 마디로 말해 화려합니다. 시선을 사로잡습니다.', '662e2a38087eafa7b6afca9f'), (9, '색상 조합이 너무 조화롭고 아름답네요. 시각적으로 매력적입니다.', '662e2a38087eafa7b6afca9f'), (25, '이미지를 보면서 마치 한 편의 예술작품을 감상하는 기분이에요.', '662e2a38087eafa7b6afcaa0'), (22, '이런 디자인을 보면서 와! 하고 소리내게 되네요. 훌륭합니다!', '662e2a38087eafa7b6afcaa0'), (27, '색감이 너무 아름답고 고요한 느낌을 주네요. 정말 멋진 그래픽이에요.', '662e2a38087eafa7b6afcaa0'), (21, '이미지가 담고 있는 메시지가 정말 인상적이에요. 잘 표현된 것 같아요.', '662e2a38087eafa7b6afcaa1'), (23, '디자인이 미래적이고 현대적입니다. 신선한 인상을 주네요.', '662e2a38087eafa7b6afcaa1'), (7, '이미지를 보면서 자연스럽게 웃음이 지어졌어요. 디자인이 마음을 환기시켜줍니다.', '662e2a38087eafa7b6afcaa1'), (27, '이미지가 담고 있는 메시지가 정말 인상적이에요. 잘 표현된 것 같아요.', '662e2a38087eafa7b6afcaa2'), (25, '디자인이 단순히 아름다울 뿐 아니라 메시지를 전달하는 데도 탁월합니다.', '662e2a38087eafa7b6afcaa2'), (21, '이미지에는 디자이너의 상상력과 창의력이 담겨져 있어요.', '662e2a38087eafa7b6afcaa2